    const dispatch = useDispatch()

    return(
        <div className="component-header">
            <p>Trello</p>
            {boards.map( board => <p>hola</p>)}
            <button className="component-button" onClick={() => dispatch(add())}>Create board</button>
        </div>
    )

}
